import React from 'react';
import UserInfo from './Components/UserInfo';
import Statistics from './Components/Statistics';
import Messages from './Components/Messages';

function App() {
  const user = {
    name: "John Doe",
    email: "john@example.com",
    role: "Admin",
    profilePicture: "https://via.placeholder.com/150", // Placeholder profile image
  };

  const statistics = {
    totalUsers: 1200,
    activeUsers: 900,  // Active users out of total
    newSignups: 150,
  };

  const messages = {
    message1: "Welcome to the dashboard!",
    message2: "You have 5 new notifications.",
    message3: "System is running smoothly.",
  };

  return (
    <div className="app-container">
      <div className="component-container">
        <UserInfo user={user} />
        <Statistics statistics={statistics} />
        <Messages messages={messages} />
      </div>
    </div>
  );
}

export default App;
